const Header = (props) => {
  return(
    <>
      <h1>{props.course}</h1>
    </>
  );
}

const Content = (props) => {
  return(
    <>
      <Part part={props.part} exercises={props.exercises1}/>
      <Part part={props.part} exercises={props.exercises2}/>
      <Part part={props.part} exercises={props.exercises3}/>

    </>
  )
}

const Part = (props) => {
  return(
    <>
      <p>
        {props.part} {props.exercises}
      </p>
    </>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.exercises + props.exercises + props.exercises}</p>
  )
}

const App = () => {

  const course = 'Half Stack application development'

  const part1 = {
    name: 'Fundamentals of React',
    exercises1: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header course={course}/>
      <Content 
        part1={part1.name} 
        exercises1={part1.exercises} 
        part2={part2.name} 
        exercises2={part2.exercises} 
        part3={part3.name} 
        exercises3={part3.exercises}
      />
      <Total exercises1={part1.exercises} exercises2={part2.exercises} exercises3={part3.exercises}/>
    </div>
  )
}

export default App
